import React from "react";
import styles from "./app.module.css";
import { data } from "../../utils/data";
import {BurgerIcon, Logo, ListIcon, ProfileIcon} from "@ya.praktikum/react-developer-burger-ui-components";
import clsx from "clsx";
import NavBar from "../nav-bar/nav-bar";
import navBar from "../nav-bar/nav-bar.modules.css";

function App() {
  return (
    <div className={styles.app}>
        <header className={clsx(styles.header, 'pt-4','pb-4')}>
            <div className={styles.headerContainer}>
                <div className={clsx(styles.menuContainer)}>
                    <NavBar>
                        <BurgerIcon className={clsx('mr-8')} type="primary"/>
                        <p className="text text_type_main-default">Конструктор</p>
                    </NavBar>

                    <NavBar>
                        <ListIcon className='mr-8' type="primary" />
                        <p className="text text_type_main-default">Конструктор</p>
                    </NavBar>

                </div>

                <div>
                    <NavBar>
                        <Logo/>
                    </NavBar>
                </div>

                <div>
                    <NavBar>
                        <ProfileIcon className='mr-8' type="primary" />
                        <p className="text text_type_main-default">Личный кабинет</p>
                    </NavBar>
                </div>
            </div>
        </header>
    </div>
  );
}

export default App;
